import './App.css';
import Image from './Image.js'
import staringCat from './images/cat-g36d4aa4b2_1280.jpg';


function App() {
  return (
    <div className="App">
      <Image scr='{ staringCat }' alt='Cute cat staring'/>
    </div>
  );
}

export default App;
